import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css';


const Menu=()=>{
    return(
        <nav className="navbar navbar-light navbar-expand-md border rounded-0 shadow-sm">
        <div className="container-fluid"><Link className="navbar-brand" to="#">Brand</Link><button data-bs-toggle="collapse" className="navbar-toggler" data-bs-target="#navcol-1"><span className="visually-hidden">Toggle navigation</span><span className="navbar-toggler-icon"></span></button>
            <div className="collapse navbar-collapse" id="navcol-1">
                <ul className="navbar-nav">
                    <li className="nav-item"><Link className="nav-link" to="/home">First Item</Link></li>
                    <li className="nav-item"><Link className="nav-link" to="/">Second Item</Link></li>
                    <li className="nav-item"><Link className="nav-link" to="/">Third Item</Link></li>
                </ul>
            </div>
        </div>
    </nav>
    );
}
export default Menu;
